import React from "react"
import Navbar from "./components/Navbar"
import Home from "./components/Home"
import About from "./components/About"
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";


function App() {
  return (
    <>
    <Router>
      <Navbar/>
      <Home/>
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route exact path="/about">
              <About />
        </Route>
      </Switch>
    </Router>
    </>
  );
}

export default App;
